import React, { useState } from 'react';
import './Track.css';

function Track(props) {
    console.log(props);

    const [toPlaylist, setToPlaylist] = useState([]);

    const addToPlaylist = (e) => {
        const el = e.target;
        setToPlaylist(e.parentNode.props);
        console.log(toPlaylist);

    }

    return(
        <div className="Track">
            <div className="Track-information">
                <h3>{props.searchResultObject.name}</h3>
                <p>{props.searchResultObject.artist} | {props.searchResultObject.album}</p>
            </div>
            <button className="buttonAddTrack" onClick={addToPlaylist}>Add</button>
        </div>
    )
}

export default Track;
